import React, { Suspense, Fragment, lazy } from 'react';
import { Switch, Redirect, Route } from 'react-router-dom';
import DashboardLayout from 'src/layouts/DashboardLayout';
import LoadingScreen from 'src/components/LoadingScreen';
import GuestGuard from 'src/components/GuestGuard';

export const renderRoutes = (routes = []) => (
  <Suspense fallback={<LoadingScreen />}>
    <Switch>
      {
      routes.map((route, i) => {
        const Guard = route.guard || Fragment;
        const Layout = route.layout || Fragment;
        const Component = route.component;

        return (
          <Route
            key={i}
            path={route.path}
            exact={route.exact}
            render={(props) => (
              <Guard>
                <Layout>
                  {route.routes? renderRoutes(route.routes) : <Component {...props} />}
                </Layout>
              </Guard>
            )}
          />
        );
      })} 

    </Switch>
  </Suspense>
);

export const routes = [
  // 메인 페이지
  {
    exact: true,
    layout: DashboardLayout,
    path: '/home',
    component: lazy(() => import('src/views/home/HomeView'))
  },

  // --------------------------------------------------------------------------------------------------------------------------------------------------//
  //        /*
  // ------------------------------------------------------------------------------------------------------------------------------------------------ //

  {
    exact: true,
    path: '/404',
    component: lazy(() => import('src/views/errors/NotFoundView'))
  },
  {
    exact: true,
    guard: GuestGuard,
    path: '/login',
    component: lazy(() => import('src/views/auth/LoginView'))
  },
  {
    exact: true,
    path: '/login-unprotected',
    component: lazy(() => import('src/views/auth/LoginView'))
  },
  {
    exact: true,
    guard: GuestGuard,
    path: '/register',
    component: lazy(() => import('src/views/auth/RegisterView'))
  },
  {
    exact: true,
    path: '/register-unprotected',
    component: lazy(() => import('src/views/auth/RegisterView'))
  },



  // --------------------------------------------------------------------------------------------------------------------------------------------------//
  //        /app/*이하
  // ------------------------------------------------------------------------------------------------------------------------------------------------ //
  {
    path: '/app',
    // guard: AuthGuard,
    layout: DashboardLayout,
    routes: [
      // 계정 정보
      {
        exact: true,
        path: '/app/account',
        component: lazy(() => import('src/views/account/AccountView'))
      },
      {
        exact: true,
        path: '/app/projects/list',
        component: lazy(() => import('src/views/project/ProjectListView'))
      },
      // --------------------------------------------------------------------------------------------------------------------------------------------------//
      //        /app/projects/*
      // ------------------------------------------------------------------------------------------------------------------------------------------------ //
      // 테스트 작성
      {
        exact: true,
        path: '/app/projects/create',
        // guard: AuthGuard,
        component: lazy(() => import('src/views/project/ProjectCreateView'))
      },
      // 성격유형 리스트 페이지
      {
        exact: true,
        path: '/app/projects/mbtiList',
        component: lazy(() => import('src/views/project/MbtiListView'))
      },
      // 선호도 조사 리스트 페이지
      {
        exact: true,
        path: '/app/projects/preferenceList',
        component: lazy(() => import('src/views/project/PreferenceListView'))
      },
      // 이상형(월드컵) 조사 리스트 페이지
      {
        exact: true,
        path: '/app/projects/worldcupList',
        component: lazy(() => import('src/views/project/WorldcupListView'))
      },
      // 트래블코리아 페이지
      {
        exact: true,
        path: '/app/projects/travelKorea',
        component: lazy(() => import('src/views/project/TravelKoreaView'))
      },
      // 트레블코리아 result page
      { 
        exact: true,
        path: '/app/projects/travelKoreaResult',
        component: lazy(() => import('src/views/project/TravelKoreaResultView'))
      },

      // 최신 등록 랭킹 리스트 페이지
      {
        exact: true,
        path: '/app/projects/recentList',
        component: lazy(() => import('src/views/project/RecentListView'))
      },
      // 참여 인원 랭킹 리스트 페이지
      {
        exact: true,
        path: '/app/projects/joinList',
        component: lazy(() => import('src/views/project/JoinListView'))
      },

      {
        exact: true,
        path: '/app/projects/:id',
        component: lazy(() => import('src/views/project/ProjectDetailsView'))
      },

      // ------------------------------------------------------------------------------------------------------------------------------------------------ //
      // /app/notice/*
      // ------------------------------------------------------------------------------------------------------------------------------------------------ //

      // 공지사항 목록 페이지
      {
        exact: true,
        path: '/app/notice/list',
        component: lazy(() => import('src/views/notice/NoticeListView'))
      },
      // 공지사항 상세보기 페이지
      {
        exact: true,
        path: '/app/notice/detail',
        component: lazy(() => import('src/views/notice/NoticeDetailView'))
      },

      // ------------------------------------------------------------------------------------------------------------------------------------------------ //
      //      /app/test/*
      // ------------------------------------------------------------------------------------------------------------------------------------------------ //

      // 테스트 인트로 페이지
      {
        exact: true,
        path: '/app/test/intro',
        component: lazy(() => import('src/views/project/ProjectIntroView'))
      },

      // MBTI 테스트 페이지
      {
        exact: true,
        path: '/app/test/mbtiTest',
        component: lazy(() => import('src/views/project/MbtiTestView'))
      },
      // 선호도 조사 테스트 페이지
      {
        exact: true,
        path: '/app/test/singleTest',
        component: lazy(() => import('src/views/project/SingleTestView'))
      },
      // 이상형 월드컵 페이지
      {
        exact: true,
        path: '/app/test/worldcup',
        component: lazy(() => import('src/views/project/WorldcupView'))
      },
      // 랭킹 테스트 페이지
      {
        exact: true,
        path: '/app/test/rankingTest',
        component: lazy(() => import('src/views/project/RankingTestView'))
      },
      // 테스트 결과 페이지
      {
        exact: true,
        path: '/app/test/result',
        component: lazy(() => import('src/views/project/ResultView'))
      },
      // 이상형 월드컵 결과 페이지
      {
        exact: true,
        path: '/app/test/worldcupResult',
        component: lazy(() => import('src/views/project/WorldcupResultView'))
      }
    ]
  },
  // ------------------------------------------------------------------------------------------------------------------------------------------------ //
  //      redirect
  // ------------------------------------------------------------------------------------------------------------------------------------------------ //
  {
    path: '*',
    routes: [
      {
        exact: true,
        path: '/',
        // component: HomeView
        component: () => <Redirect to="/home" />
      },
      {
        component: () => <Redirect to="/404" />
      }
    ]
  }
];
